import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './components/Home';
import Profile from './components/Profile';
import Forum from './components/Forum';
import Blog from './components/Blog';
//import Login from './components/Login';
import Register from './components/Register';
import Sidebar from './components/Sidebar';
import Header from './components/Header';
import { Container, Grid2, Item } from '@mui/material';
import './App.css';

const App = () => {
  return (
      <Grid2 container spacing={2}>
        <Grid2 size={{ xs: 6, md: 4 }}> {/* Sidebar takes 3/12 of the width on small screens and 100% on extra small */}
          <Item><Sidebar /></Item>
        </Grid2>
        <Grid2 size={{ xs: 6, md: 4 }}> {/* Content area takes 9/12 of the width on small screens and 100% on extra small */}
          <Item><Header />
          <Container style={{ padding: '20px' }}>
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/profile" element={<Profile />} />
              <Route path="/forum" element={<Forum />} />
              <Route path="/blog" element={<Blog />} />
              <Route path="/register" element={<Register />} />
            </Routes>
          </Container>
          </Item>
        </Grid2>
      </Grid2>
  );
};
export default App;
